int minSizeSubarray(int* nums, int numsSize, int target) {
    int totalSum = 0;
    for (int i = 0; i < numsSize; i++) {
        totalSum += nums[i];
    }
    if (totalSum == target) {
        return numsSize;
    }
    if (totalSum < target) {
        return -1;
    }

    int result = INT_MAX;
    int prefixSums[numsSize * 2];
    prefixSums[0] = 0;
    for (int i = 0; i < numsSize * 2; i++) {
        prefixSums[i + 1] = prefixSums[i] + nums[i % numsSize];
    }

    for (int i = 0; i < numsSize; i++) {
        int sum = 0;
        for (int j = i; j < i + numsSize; j++) {
            sum += nums[j % numsSize];
            if (sum >= target) {
                result = result < (j - i + 1) ? result : (j - i + 1);
                break;
            }
        }
    }

    return result == INT_MAX ? -1 : result;
}
